import React, {useState} from 'react'


function SearchResults() {

    const [tracklist, setTracklist] = useState([]);

    setTracklist=([
        {'id':'1',
        'title': 'song 1',
        'artist': 'artist 1',
        'album': 'album 1'
        },
        {'id':'2',
           'title': 'song 2',
        'artist': 'artist 2',
        'album': 'album 2'
        },
        {'id':'3',
        'title': 'song 3',
        'artist': 'artist 3',
        'album': 'album 3'
        },
        {'id':'4',
        'title': 'song 4',
        'artist': 'artist 4',
        'album': 'album 4'
        },
    ])

    function TrackList(tracklist) {
        return (
        <ul>
            {tracklist.map(song =>
            <li key={song.id}>
                <p>{song.title}</p>
                <p>{song.artist}</p>
                <p>{song.album}</p>
                <button 
                    type='button'
                    /*onClick={}*/
                >+</button>
            </li>)}
        </ul>
        )
    }

    return(
        <>
            <TrackList />
        </>
    )
}

export default SearchResults;
